import React from 'react'

function Header(props) {
    return (
        <header>
            <h1>Sunny Gang Game</h1>
            <div className = "scoreboard" style = {{position: "relative", float:"right"}}>
                <h1>Score: {props.score} | Streak: {props.streak}</h1>
            </div>

        </header>
    )
}
export default Header;
